:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Edward Marsh and DAVIS, Jane
  JWILLIAMS, Henry Edward and CONNELL, Isabelle Annie
  JWILLIAMS, Henry Carleton and MILLS, Catherine Leslie
  WILLIAMS, Virginia Carleton and ROBINSON, Hugh Amuri
  04> WILLIAMS, Virginia Carleton m on 30.07.1949 to ROBINSON, Hugh Amuri
  b 05.11.1923
  b 29.09.1912 d 18.08.1995
  Virginia b. at Gisborne and m. at Manutuke, Hugh, s/o Samuel Amuri Robinson (farmer) and May Isabella
  Williams (nurse), b, at New Plymouth. Address: 4a Wendwood Lane, Keri Keri.
  Virginia was educated at Woodford House and Otago University. She was School Prefect, Music Prefect
  and Head of Rouncil House in her last year at school. She served in the NZ Land Army at Muriwai,
  Gisborne (1942-45) then attended the New Zealand School of Physiotherapy (1946-48). She was charge
  physiotherapist at Waipukurau Hospital (1948-49).
  Virginia was actively involved in Flemington School in Central Hawke's Bay, serving on both the PTA and
  the School Committee. She joined the Red Cross in 1963 and is still actively involved. Since moving
  to Kerikeri she has served as President and Secretary of the Kerikeri branch and President of the Bay
  of Islands Centre of NZ Red Cross Inc. She was an organist and vestry member at St Mary's Parish,
  Waipukurau and has been an organist at Waimate North parish since 1978, and a vestry member of that
  parish since 1997.
  Hugh (DSO, MC, Mid, ED and 3 Bars) was a retired farmer. He left the Army as a Brigadier. He was
  involved in community affairs, serving on the Flemmington School Committee, the Waipukurau County
  Council, and St Mary's (Waipukurau Parish) Vestry. He also served as President of the Hawke's Bay
  Province of Federated Farmers and as Vice-President of the Meat and Wool Section of Federated Farmers.
  After moving to the Bay of Islands, he was President of the Ohaeawai Branch of Federated Farmers, and
  worked towards Northland becoming its own Province of Federated Farmers rather than being part of
  Auckland Province.
  Hugh's recreational interests included bowls and sailing. He was Commodore of the Kerikeri Cruising
  Club for two years.
  01> ROBINSON, Samuel Amurim on 05.11.1977 to WOOD, Penelope Anne
  b 12.04.1950
  b 25.05.1956
  Samuel b. at Waipukurau, Penelope, d/o Peter Wood and Elizabeth Kirk, b. at Cornwall, England.
  Address: Te Maire, RD 2, Waipukurau.
  Samuel was educated at Flemington School and Christ's College, Christchurch (School House, House
  Prefect in his last year). He graduated from Lincoln College with a BAgSci with Hons in Farm
  Management and took up farming. He was Hawkes Bay Farmer of the Year in 1986 and won the AC
  Cameron Award in 1994. Samuel has served on the Hawkes Bay Catchment Board (Chairman of the
  Finance Committee) and on the Hawkes Bay Regional Council. He is currently Chairman of Richmond
  Ltd and also a director of Port of Napier and of Farmlands. He has the rank of Captain in the
  Territorial Army.
  01> ROBINSON, Henrietta Anne
  b 18.03.1980
  Henrietta b. at Waipukurau. She was a student at Woodford House, Havelock North and is now
  studying Commerce at Otago University.
  02> ROBINSON, Hugh Amuri
  b 13.11.1981
  Hugh b. at Waipukurau. He is a student at Christ's College, Christchurch.
  02> ROBINSON, Hugh Carleton m on 07.06.1980 to BOWLER, Rosalee Vita
  b 02.10.1951
  b 12.08.1955
  Carl 6. at Waipukurau and m. at Matamata. Rosalee, d/o William Bowler and Thelma Hawes. Address:
  "Raratu", RD 3, Kerikeri.
  Carl was educated at Flemington School and Christ's College, Christchurch (School House, House
  prefect) and gained a Diploma of Agriculture at Massey University in 1976. He is involved in
  Federated Farmers, is a Rotarian and a director of the Northland Port Corporation.
